import React from 'react';

const ImagesList = props => {
	const imagez = props.images.map(image => {
		return (
			<img
				src={image.urls.regular}
				alt={image.alt_description}
				key={image.id}
			/>
		);
	});
	return <div>{imagez}</div>;
};

export default ImagesList;
